¥ begÃ¤ra att vi tar bort alla personuppgifter vi har om dig. Detta omfattar inte eventuella uppgifter som vi Ã¤r tvungna att spara av administrativa, legala eller sÃ¤kerhetsÃ¤ndamÃ¥l.</p><h2>Vart vi skickar dina upgifter</h2><p>Kommentarer frÃ¥n besÃ¶kare kanske kontrolleras via en automatiserad tjÃ¤nst fÃ¶r detektering av skrÃ¤ppost.</p><h2>Din kontaktinformation</h2><h2>Ytterligare information</h2><h3>Hur vi skyddar din information</h3><h3>Vilka procedurer vi har fÃ¶r datalÃ¤ckor</h3><h3>FrÃ¥n vilka utomstÃ¥ende parter vi tar emot data</h3><h3>Vilket automatiserat beslutsfattande och/eller profilskapande vi gÃ¶r med vÃ¥ra anvÃ¤ndaruppgifter</h3><h3> Branschkrav om delgivning av information</h3>', 'Integritetspolicy', '', 'draft', 'closed', 'open', '', 'integritetspolicy', '', '', '2018-11-29 17:01:23', '2018-11-29 16:01:23', '', 0, 'http://localhost/halkans/?page_id=3', 0, 'page', '', 0),
