(356, 1, '2018-12-19 12:06:55', '2018-12-19 11:06:55', '<!-- wp:image {\"id\":143} -->\n<figure class=\"wp-block-image\"><img src=\"http://localhost/halkans/wp-content/uploads/2018/12/webuy1-e1545217499710-1024x307.jpeg\" alt=\"Guitars hanging on the wall\" class=\"wp-image-143\"/></figure>\n<!-- /wp:image -->\n\n<h1>Sell your old instrument to us</h1>\n<p>We buy mostly any Jazz, Pop, Rock and Beatles-related instrument from the early 50\'s up to late 70\'s. Please send us an email with a picture of what you are looking to sell or come into the store.</p>\n<h2>...or sell through us</h2>\n<p>We can help you sell your guitar or bass on commisson. We take 20% + 5%tax for commison sales.</p>', 'We buy', '', 'inherit', 'closed', 'closed', '', '14-revision-v1', '', '', '2018-12-19 12:06:55', '2018-12-19 11:06:55', '', 14, 'http://localhost/halkans/14-revision-v1/', 0, 'revision', '', 0),
