(878, 1, '2019-01-19 14:05:36', '2019-01-19 13:05:36', '<!-- wp:html -->\n<div class=\"usps\"><p>Home of Vintage Musical Instruments! <br/> Where Stars Buy Guitars!</p><>/div>\n<!-- /wp:html -->\n\n<!-- wp:image {\"id\":53,\"className\":\"full-width\"} -->\n<figure class=\"wp-block-image full-width\"><img src=\"http://localhost/halkans/wp-content/uploads/2018/12/Halkan-1-e1543668680977.jpg\" alt=\"\" class=\"wp-image-53\"/></figure>\n<!-- /wp:image -->\n\n<!-- wp:html -->\n<div class=\"text-content\">\n<!-- /wp:html -->\n\n<!-- wp:heading {\"level\":1,\"className\":\"front-page-heading\"} -->\n<h1 class=\"front-page-heading\">Welcome to Halkan\'s Rockhouse!<br></h1>\n<!-- /wp:heading -->\n\n<!-- wp:paragraph -->\n<p>The first established and the main vintage guitardealer in Scandinavia. We sell, buy, trade, consign and repair vintage, electrical and acoustic &nbsp;stringinstruments. We also handle various classic tubeamplifiers and speakers.<br><br>If you want further information about instruments on our stocklist or if you wish to sell/buy something not listed, please give us a call or send an email! We ship worldwide to &nbsp;your door.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:html -->\n</div>\n<!-- /wp:html -->\n\n<!-- wp:paragraph -->\n<p></p>\n<!-- /wp:paragraph -->', 'Home', '', 'inherit', 'closed', 'closed', '', '5-revision-v1', '', '', '2019-01-19 14:05:36', '2019-01-19 13:05:36', '', 5, 'http://localhost/halkans/5-revision-v1/', 0, 'revision', '', 0),
