(547, 1, '2018-12-19 15:50:35', '2018-12-19 14:50:35', '<!-- wp:image {\"id\":143,\"className\":\"full-width\"} -->\n<figure class=\"wp-block-image full-width\"><img src=\"http://localhost/halkans/wp-content/uploads/2018/12/webuy1-e1545217499710.jpeg\" alt=\"Guitars hanging on the wall\" class=\"wp-image-143\"/></figure>\n<!-- /wp:image -->\n\n<!-- wp:html -->\n<div class=\"text-content\">\n<!-- /wp:html -->\n\n<!-- wp:heading {\"level\":1} -->\n<h1>Sell your old instrument to us</h1>\n<!-- /wp:heading -->\n\n<!-- wp:paragraph -->\n<p>\nWe buy mostly any Jazz, Pop, Rock and Beatles-related instrument from the early 50\'s up to late 70\'s. Please send us an email with a picture of what you are looking to sell or come into the store.\n\n</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:heading -->\n<h2>...or sell through us</h2>\n<!-- /wp:heading -->\n\n<!-- wp:paragraph -->\n<p>\nWe can help you sell your guitar or bass on commisson. We take 20% + 5%tax for commison sales.\n\n</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:html -->\n</div>\n<!-- /wp:html -->', 'We buy', '', 'inherit', 'closed', 'closed', '', '14-revision-v1', '', '', '2018-12-19 15:50:35', '2018-12-19 14:50:35', '', 14, 'http://localhost/halkans/14-revision-v1/', 0, 'revision', '', 0),
(548, 1, '2018-12-19 15:58:23', '2018-12-19 14:58:23', '<!-- wp:image {\"id\":157,\"className\":\"full-width\"} -->\n<figure class=\"wp-block-image full-width\"><img src=\"http://localhost/halkans/wp-content/uploads/2018/12/IMG_3862-1-e1544118913348.jpeg\" alt=\"Working on a guitar in the repair shop.\" class=\"wp-image-157\"/></figure>\n<!-- /wp:image -->\n\n<!-- wp:html -->\n<div class=\"text-content\">\n<!-- /wp:html -->\n\n<!-- wp:heading {\"level\":1} -->\n<h1>Repairs</h1>\n<!-- /wp:heading -->\n\n<!-- wp:paragraph -->\n<p>\nWe repair all instruments and amps. List with prices to be updated.\n\n</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:html -->\n</div>\n<!-- /wp:html -->', 'Repairs', '', 'inherit', 'closed', 'closed', '', '16-revision-v1', '', '', '2018-12-19 15:58:23', '2018-12-19 14:58:23', '', 16, 'http://localhost/halkans/16-revision-v1/', 0, 'revision', '', 0),
