(923, 1, '2019-01-22 10:22:40', '2019-01-22 09:22:40', '<!-- wp:image {\"id\":922,\"className\":\"full-width\"} -->\n<figure class=\"wp-block-image full-width\"><img src=\"http://localhost/halkans/wp-content/uploads/2019/01/cover-stor.jpg\" alt=\"Jan &quot;Halkan&quot; Hallquist in the store.\" class=\"wp-image-922\"/></figure>\n<!-- /wp:image -->\n\n<!-- wp:html -->\n<div class=\"text-content\">\n<!-- /wp:html -->\n\n<!-- wp:heading {\"level\":1,\"className\":\"front-page-heading\"} -->\n<h1 class=\"front-page-heading\">Welcome to Halkan\'s Rockhouse!<br></h1>\n<!-- /wp:heading -->\n\n<!-- wp:heading {\"level\":3} -->\n<h3>\"Home of Vintage Musical Instruments\"</h3>\n<!-- /wp:heading -->\n\n<!-- wp:paragraph -->\n<p>The first established and the main vintage guitardealer in Scandinavia. We sell, buy, trade, consign and repair vintage, electrical and acoustic stringinstruments. We also handle various classic tubeamplifiers and speakers</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>\nIf you want further information about instruments on our stocklist or if\n you wish to sell/buy something not listed, please give us a call or \nsend an email! We ship worldwide to &nbsp;your door.\n\n</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:html -->\n</div>\n<!-- /wp:html -->\n\n<!-- wp:paragraph -->\n<p></p>\n<!-- /wp:paragraph -->', 'Home', '', 'inherit', 'closed', 'closed', '', '5-revision-v1', '', '', '2019-01-22 10:22:40', '2019-01-22 09:22:40', '', 5, 'http://localhost/halkans/5-revision-v1/', 0, 'revision', '', 0),
